import logo from "./logo.svg";
import "./App.css";
import React, { useEffect, useState } from "react";

const File = ({ backendData }) => {
  return (
    <div className="file">
      <h2>Name: {backendData[0]}</h2>
      <div>
        <h3>Users</h3>
        {backendData[2].map((u) => {
          return <div>u.displayName</div>;
        })}
        <div className="download">
          <button onClick={() => {}}>Download</button>
        </div>
      </div>
    </div>
  );
};

function App() {
  const [files, setFiles] = useState({});
  useEffect(() => {
    fetch("/localtunnel")
      .then((response) => response.json())
      .then((data) => {
        const socket = new WebSocket(`ws://${data.url}`);
        socket.onopen = () => {
          console.log("WebSocket connection established");
        };

        socket.onmessage = (event) => {
          const updateData = JSON.parse(event.data);
          setFiles(updateData);
        };

        return () => {
          socket.close();
        };
      })
      .catch((error) => {
        console.error("Error fetching localtunnel URL:", error);
      });
  }, []);

  return (
    <div className="App">
      {Object.entries(files).map(([id, perm]) => {
        return <File backendData={[id, perm]} />;
      })}
    </div>
  );
}

export default App;
